// BelowThreshold.java
package scenario1;

import java.util.List;

class BelowThreshold {

    public static Boolean belowThreshold(List<Integer> l, int t) {
        for (int i = 0; i < l.size(); i++) {
            if (l.get(i) >= t) {
                return false;
            }
        }
        return true;
    }
}

